import React, { useEffect, useState } from 'react';
import HeroSection from '../../components/landingpage/HeroSection.js';
import AboutUs from './../../components/landingpage/AboutUs';
import Services from './../../components/landingpage/Services';
import Portfolio from './../../components/landingpage/Portfolio';
import Testimonials from './../../components/landingpage/Testimonials';
import ContactUs from './../../components/landingpage/ContactUs';
import FAQ from './../../components/landingpage/FAQ';

const LandingPage = () => {
  const [headerColor, setHeaderColor] = useState('#00183d');

  const handleScroll = () => {
    const scrollTop = window.scrollY;
    if (scrollTop > 50) {
      setHeaderColor('#002d55');
    } else {
      setHeaderColor('#00183d');
    }
  };

  useEffect(() => {
    window.addEventListener('scroll', handleScroll);
    return () => {
      window.removeEventListener('scroll', handleScroll);
    };
  }, []);

  const scrollToSection = (id) => {
    const element = document.getElementById(id);
    if (element) {
      element.scrollIntoView({ behavior: 'smooth' });
    }
  };

  return (
    <div>
      <header style={{ 
        position: 'fixed', 
        top: 0, 
        left: 0, 
        right: 0, 
        backgroundColor: headerColor, 
        zIndex: 1000, 
        padding: '10px 15px', 
        height: '70px', 
        display: 'flex', 
        alignItems: 'center', 
        justifyContent: 'space-between' 
      }}>
        <img 
          src={require('./../../assets/logo.png')} 
          alt="Logo" 
          style={{ 
            height: '40px',
            '@media (max-width: 768px)': {
              height: '35px'
            }
          }} 
        />
        <nav>
          <ul style={{ 
            display: 'flex', 
            listStyleType: 'none', 
            margin: 0, 
            padding: 0,
            gap: '15px'
          }}>
            <li>
              <a 
                href="#about-us" 
                onClick={(e) => { e.preventDefault(); scrollToSection('about-us'); }} 
                style={{ 
                  color: 'white', 
                  textDecoration: 'none', 
                  fontWeight: 'bold', 
                  fontSize: 'clamp(14px, 3vw, 18px)',
                  transition: 'color 0.3s', 
                }}
                onMouseEnter={(e) => e.currentTarget.style.color = '#FFD700'}
                onMouseLeave={(e) => e.currentTarget.style.color = 'white'}
              >
                About Us
              </a>
            </li>
            <li>
              <a 
                href="#services" 
                onClick={(e) => { e.preventDefault(); scrollToSection('services'); }} 
                style={{ 
                  color: 'white', 
                  textDecoration: 'none', 
                  fontWeight: 'bold', 
                  fontSize: 'clamp(14px, 3vw, 18px)',
                  transition: 'color 0.3s', 
                }}
                onMouseEnter={(e) => e.currentTarget.style.color = '#FFD700'}
                onMouseLeave={(e) => e.currentTarget.style.color = 'white'}
              >
                Services
              </a>
            </li>
            <li>
              <a 
                href="#portfolio" 
                onClick={(e) => { e.preventDefault(); scrollToSection('portfolio'); }} 
                style={{ 
                  color: 'white', 
                  textDecoration: 'none', 
                  fontWeight: 'bold', 
                  fontSize: 'clamp(14px, 3vw, 18px)',
                  transition: 'color 0.3s', 
                }}
                onMouseEnter={(e) => e.currentTarget.style.color = '#FFD700'}
                onMouseLeave={(e) => e.currentTarget.style.color = 'white'}
              >
                Portfolio
              </a>
            </li>
          </ul>
        </nav>
      </header>

      <div style={{ paddingTop: '90px' }}>
        <HeroSection />
        <div id="about-us">
          <AboutUs />
        </div>
        <div id="services">
          <Services />
        </div>
        <div id="portfolio">
          <Portfolio />
        </div>
        <Testimonials />
        <ContactUs />
        <FAQ />
      </div>
    </div>
  );
};

export default LandingPage;
